import React, { useState, useEffect } from "react";
import { useSearchParams, useNavigate } from "react-router-dom";
import axios from "axios";
import FilterEdit from "../components/filters/filterEdit";
import CategoryFilterEdit from "../components/filters/catFilterEdit";
import "./subspaceCreator.css";

function EditSubspace() {
  const [searchParams] = useSearchParams();
  const subspaceId = searchParams.get("id");
  const [attributes, setAttributes] = useState([]);
  const [selectedAttributes, setSelectedAttributes] = useState([]);
  const [filters, setFilters] = useState({});
  const [subspaceName, setSubspaceName] = useState("");
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSubspaceData = async () => {
      try {
        console.log("Fetching attributes and subspace data...");
        setLoading(true);

        // Fetch all attributes and their ranges
        const attributesResponse = await axios.get("http://127.0.0.1:5000/feature_ranges");
        console.log("Attributes response:", attributesResponse.data);

        if (!attributesResponse.data || !attributesResponse.data.feature_ranges) {
          throw new Error("Invalid response: 'feature_ranges' key missing");
        }

        const fetchedAttributes = Object.entries(attributesResponse.data.feature_ranges).map(([name, range]) => ({
          id: name,
          name,
          range: range.map(Number),
        }));
        setAttributes(fetchedAttributes);

        // Fetch the existing subspace details
        console.log(`Fetching subspace filter for subspace ID: ${subspaceId}`);
        const subspaceResponse = await axios.get(
          `http://127.0.0.1:5000/get_subspace_filter?sub_ind=${subspaceId}`
        );
        console.log("Subspace response:", subspaceResponse.data);

        const subspaceData = subspaceResponse.data;
        if (subspaceData) {
          console.log("Setting subspace data...");
          setSubspaceName(subspaceData.name || `Subspace ${subspaceId}`);

          // Set selected attributes and filters from the retrieved subspace
          const selected = subspaceData.features.map((feature) =>
            fetchedAttributes.find((attr) => attr.name === feature)
          );
          console.log("Selected attributes:", selected);
          setSelectedAttributes(selected);

          const filtersMap = {};
          subspaceData.features.forEach((feature, index) => {
            filtersMap[feature] = subspaceData.ranges[index];
          });
          console.log("Filters map:", filtersMap);
          setFilters(filtersMap);
        } else {
          throw new Error("Subspace not found.");
        }
      } catch (err) {
        console.error("Error fetching subspace data:", err);
        setError(err.response?.data?.error || "Error fetching subspace data. Please try again.");
      } finally {
        setLoading(false);
        console.log("Fetching subspace data complete.");
      }
    };

    fetchSubspaceData();
  }, [subspaceId]);

  const isCategorical = (name) => {
    const categoricalVariables = ["sex", "cp", "restecg", "exang", "slope", "thal", "target"];
    return categoricalVariables.includes(name);
  };

  const handleSelectAttribute = (attribute) => {
    console.log("Selecting attribute:", attribute);
    if (selectedAttributes.some((attr) => attr.id === attribute.id)) {
      alert("Attribute already selected!");
      return;
    }

    setSelectedAttributes([...selectedAttributes, attribute]);

    const defaultFilter = isCategorical(attribute.name)
      ? Array.from({ length: attribute.range[1] - attribute.range[0] + 1 }, (_, i) => attribute.range[0] + i)
      : { min: attribute.range[0], max: attribute.range[1] };

    setFilters({
      ...filters,
      [attribute.name]: defaultFilter,
    });
    console.log("Updated filters after selection:", filters);
  };

  const handleDeselectAttribute = (attribute) => {
    console.log("Deselecting attribute:", attribute);
    setSelectedAttributes(selectedAttributes.filter((attr) => attr.id !== attribute.id));
    const updatedFilters = { ...filters };
    delete updatedFilters[attribute.name];
    setFilters(updatedFilters);
    console.log("Updated filters after deselection:", updatedFilters);
  };

  const handleFilterChange = (name, newFilterValues) => {
    console.log(`Filter changed for ${name}:`, newFilterValues);
    setFilters({ ...filters, [name]: newFilterValues });
  };

  const handleSaveChanges = async () => {
    try {
      console.log("Saving changes...");
      const features = Object.keys(filters);
      const ranges = features.map((feature) =>
        isCategorical(feature) ? filters[feature] : [filters[feature].min, filters[feature].max]
      );

      const payload = {
        sub_ind: Number(subspaceId), // Subspace ID for update
        features,
        ranges,
      };

      console.log("Payload for update:", payload);

      const response = await axios.post("http://127.0.0.1:5000/update_subspace", payload);

      console.log("Update response:", response.data);

      if (response.data.update_state) {
        alert(`Subspace "${subspaceName}" updated successfully!`);
        navigate("/");
      } else {
        alert("Failed to update subspace. Please try again.");
      }
    } catch (err) {
      console.error("Error updating subspace:", err);
      alert("Error updating subspace. Please try again.");
    }
  };

  if (loading) return <div>Loading subspace data...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="add-subspace-page">
      <div className="left-column">
        <div className="attributes-list">
          <h2>Available Attributes</h2>
          {attributes.length > 0 ? (
            <ul>
              {attributes.map((attr) => (
                <li
                  key={attr.id}
                  onClick={() => handleSelectAttribute(attr)}
                  className={selectedAttributes.some((a) => a.id === attr.id) ? "selected" : ""}
                >
                  {attr.name}
                </li>
              ))}
            </ul>
          ) : (
            <p>No attributes available.</p>
          )}
        </div>

        <div className="selected-attributes">
          <h2>Selected Attributes</h2>
          <ul>
            {selectedAttributes.map((attr) => (
              <li
                key={attr.id}
                onClick={() => handleDeselectAttribute(attr)}
                style={{ backgroundColor: "#e7ffe7" }}
              >
                {attr.name}
              </li>
            ))}
          </ul>
        </div>
      </div>

      <div className="filter-panel">
        <h2>Filter Options</h2>
        {selectedAttributes.length === 0 ? (
          <p>Select an attribute to configure its filter.</p>
        ) : (
          selectedAttributes.map((attr) =>
            isCategorical(attr.name) ? (
              <CategoryFilterEdit
                key={attr.id}
                name={attr.name}
                range={attr.range}
                onFilterChange={handleFilterChange}
                defaultFilter={filters[attr.name] || []}
              />
            ) : (
              <FilterEdit
                key={attr.id}
                name={attr.name}
                min={attr.range[0]}
                max={attr.range[1]}
                onFilterChange={handleFilterChange}
                defaultFilter={filters[attr.name] || { min: attr.range[0], max: attr.range[1] }}
              />
            )
          )
        )}
        <div className="actions">
          <button className="save-button" onClick={handleSaveChanges}>
            Save Changes
          </button>
          <button className="cancel-button" onClick={() => navigate("/")}>
            Cancel
          </button>
        </div>
      </div>
    </div>
  );
}

export default EditSubspace;
